package vo;import java.io.Serializable;public class tablaUsuariosRolesVO implements Serializable{	private static final long serialVersionUID = 2914853243027201865L;		private String documento;	private String contraseña;	private String rol;			public tablaUsuariosRolesVO(){}		public tablaUsuariosRolesVO( String doc, String cont, String rol) {		this.documento=doc;		this.contraseña=cont;		this.rol=rol;	}	public void toModelo() {	}	public String getDocumento() {		return documento;	}	public void setDocumento(String documento) {		this.documento = documento;	}	public String getContraseña() {		return contraseña;	}	public void setContraseña(String contraseña) {		this.contraseña = contraseña;	}	public String getRol() {		return rol;	}	public void setRol(String rol) {		this.rol = rol;	}					}